<template>
	<div id="page">
		<div id="prompt-wrapper" v-if="triesRemaining">
			<div id="w">
				<img id="w-image" alt="w" @contextmenu.prevent="" src="data:image/png;base64,">
			</div>
			<input type="text" name="p" id="input" @keyup.enter="decrypt">
			<p id="remaining" v-text="remaining"></p>
			<br>
		</div>
	</div>
</template>

<script>
import CryptoJS from 'crypto-js'
import FileSaver from 'file-saver'
export default {
	async asyncData({ $axios }) {
		try {
			await $axios.$get("https://api.countapi.xyz/hit/DgLBeoZsLFe7wQ5J9OdV1/encrypted")
			return {
				tries: 0,
				enc: null
			}
		} catch (error) {}
	},
	computed: {
		triesRemaining: function() { return this.tries > 0 },
		remaining: function() {
			if (this.tries > 1) {
				return `${this.tries} tries remaining`
			} else if (this.tries == 1) {
				return "1 try remaining"
			} else if (this.tries <= 0) {
				return "0 tries remaining"
			}
		}
	},
	methods: {
		decrypt: async function() {
			if (this.enc == null) {
				let e = await this.$axios.$get(`/assets/e.json`)
				this.enc = e
			}
			let p = document.getElementById("input")
			try {
				const b = CryptoJS.AES.decrypt(this.enc, p.value)
				const d = JSON.parse(b.toString(CryptoJS.enc.Utf8))
				let body = document.querySelector("body")
				p.value = ""
				body.innerHTML = d.h
				let text = new Blob([d.t], {type: "text/plain"})
				FileSaver.saveAs(text, "_.txt")
			} catch (error) {
				this.tries--
				localStorage.setItem("t", this.tries)
				p.value = ""
			}
		}
	},
	mounted() {
		let l = localStorage.getItem("t")
		if (l == null) {
			localStorage.setItem("t", 3)
			this.tries = 3
		} else this.tries = l
	}
}
</script>

